import { faLongArrowAltDown } from '@fortawesome/free-solid-svg-icons';
import { TableRow } from '@material-ui/core';



function Der() {
  return (
    <Container className="container" fluid>
        <Row className="Der">
            <Col sm={5}>
                <img className="picDetail"src={pic3}></img> 
            </Col>
            <Col sm={7}>
                <Row className="text5">
                    <p>Der arbotena Test - so funktioniert's</p>
                </Row>
                <Row className="text4">
                    <LoremIpsum sentenceLowerBound="30"/>
                </Row>
            </Col>
        </Row>
  </Container>    
          
  );
}

export default Der;
